import { useState } from 'react';
import './index.css';
import InputSelectionButton from './InputSelectionButton';
import SelectedInput from './SelectedInput';
import Calendar from './Calendar';

export default function InputSection() {
  const [pressedBtn, setPressedBtn] = useState(1)

  function handleClick(i)
  {
    setPressedBtn(i)
  }

  return (
    <div className="input-section">
      <h1>INPUT SECTION {pressedBtn}</h1>
      <InputSelectionButton onBtnClick={()=>handleClick(1)}/>
      <InputSelectionButton onBtnClick={()=>handleClick(2)}/>
      <InputSelectionButton onBtnClick={()=>handleClick(3)}/>
      <InputSelectionButton onBtnClick={()=>handleClick(4)}/>
      <InputSelectionButton onBtnClick={()=>handleClick(5)}/>
      <SelectedInput value={pressedBtn}/>
      <Calendar />
    </div>
  );
}
